import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  let expensesContent = (
    <p className="expenses-list__fallback">No expense found</p>
  );

  if (items.length > 0) {
    expensesContent = items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }

  return <ul className='expenses-list'></ul>

};


